import React from "react";

function Contact() {
  return (
    <div className="contact">
      <h1>CONTACT PAGE</h1>
      <button>Facebook</button>
      <button>Calendly</button>
      <a href="https://www.facebook.com/groups/quietlythriving" className="button">Go to Facebook</a>

<input type="button" onClick="location.href='https://www.facebook.com/groups/quietlythriving';" value="Go to Facebook" />

    </div>
  );
}

export default Contact;
